import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginForm from "./pages/login_signup";
import './App.css';

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Router path="/" element={<LoginForm />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
